import React, { useEffect } from 'react';
import './css/AboutMe.css';

function AboutMe() {
  return (
    <div className="mainContainer">
      <section className="fullHeight fullWidth pg" id="page1">
        page1
      </section>
      <section className="fullHeight fullWidth pg" id="page2">
        page2
      </section>
      <section className="fullHeight fullWidth pg" id="page3">
        page3
      </section>
    </div>
  );
}

export default AboutMe;
